import "./App.css";
import ThemeButton from "./components/Navbar/ThemeButton";
import Navbar from "./components/Navbar/Navbar";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function App() {
  return (
    <div>
      <Router>
        <Navbar />
        <Switch>
          <Route path="/" />
        </Switch>
      </Router>

      <div>HELLO FRIEND</div>
    </div>
  );
}

export default App;
